import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

class Navbar extends Component {
    state = {  } 
    render() { 
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <a  
                    style={{color: "black", marginLeft: "30px"}} 
                    class="navbar-brand" href="#">
                    BalmCo
                </a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <li className="nav-item active">
                            <a className="nav-link" href="#">Mission</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Find</a>
                        </li>
                        <li>
                            <a style={{display: "flex", flexMargin: 100}}></a>
                        </li>
                        <li>
                            <button 
                                style={{color: "red", marginRight: "6px"}}
                                className="btn btn-outline-primary" href="#">Patient</button>
                        </li>
                        <li>
                            <button 
                                style={{marginRight: "6px"}}
                                className="btn btn-outline-primary" href="#">Physician</button>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}
 
export default Navbar;
